/*---------------------------------------------------------------------------------------------------------------------------------------------------------------------------------
 * @brief:	Initialise cooling specific image interface.
 * @param:	None.
 * @retval:	None.
 *-------------------------------------------------------------------------------------------------------------------------------------------------------------------------------*/
void									UITFTDSP_IMAGE_COOLING__Initialise(void)
{
	uint16_t	uiIndex;

	for ( uiIndex = 0; uiIndex < UITFTDSP_IMAGE_COOLING__MAX_IMAGES; uiIndex++ )
	{
		maCoolingImage[uiIndex].ulRAMStartAddx = 0;
	}

	return;
}
/*---------------------------------------------------------------------------------------------------------------------------------------------------------------------------------
 * @brief:	Returns a pointer to the image details.
 * @param:	vImageNumber - the image number of type : UITFTDSP_IMAGE_COOLING__IMAGE_NUMBER.
 * @retval:	Pointer to UITFTDSP_IMAGE_COMMON__ImageDetails.
 *-------------------------------------------------------------------------------------------------------------------------------------------------------------------------------*/
UITFTDSP_IMAGE_COMMON__ImageDetails*	UITFTDSP_IMAGE_COOLING__pImage(UITFTDSP_IMAGE_COOLING__IMAGE_NUMBER vImageNumber)
{
	UITFTDSP_IMAGE_COMMON__ImageDetails*	pImage = COM_DEFN__NULL;

	if ( vImageNumber < UITFTDSP_IMAGE_COOLING__MAX_IMAGES )
	{
		// Get the image using number as index
		pImage = &maCoolingImage[vImageNumber];
		// Assign the image definition details
		pImage->pDefinition = &mkaCoolingImageDefinition[vImageNumber];
	}

	return pImage;
}
